def calculate(capacity, demand):
    MAX_GEN = 100
    neighbourNum = 50
    tabuLength = 20
    curBestFit = 10000000
    gobalFit = 10000000    # 全局最优解
    bestPermutation = []
    curBestPermutation = []
    tabuTable = []
    for i in range(MAX_GEN):
        print(i)
        if i == 0:
            neighbourPermutations = getNeighbourhood(demand, neighbourNum)
        else:
            neighbourPermutations = getNeighbourhood(bestPermutation, neighbourNum)
        for j in neighbourPermutations:
            # curFit = getMinimumBins(j, capacity)
            curFit = BFD(j, capacity)
            #curFit = FFD(j, capacity)
            if(curFit < curBestFit):
                flag = 0
                for k in tabuTable:
                    if sorted(j) == sorted(k):
                        flag = 1
                        break
                if flag==0:
                    curBestFit = curFit
                    curBestPermutation = j
        # 找到第一个不在禁忌表中的集合
        # 更新禁忌表
        if len(tabuTable) == tabuLength:
            tabuTable.pop(1)
        tabuTable.append(curBestPermutation)
        print(curBestFit)
        # 更新最佳集合
        if(curBestFit < gobalFit):
            bestPermutation = curBestPermutation
            print(capacity, curBestFit)
            print(curBestPermutation)
            gobalFit = curBestFit
    return gobalFit, bestPermutation

def getMinimumBins(weights, capacity):
    boxes = [0 for i in range(len(weights))]
    result = 0
    for i in range(0, len(weights)):
        for j in range(0, len(boxes)):
            if weights[i]+boxes[j] <= capacity:
                boxes[j] += weights[i]
                result = max(result, j+1)
                break
    return result



def BFD(weights,capacity):
    # weights = [2,3,3,4,5,6,7]
    # capacity = 10
    boxes = [0 for i in range(len(weights))]
    box_old = {}

    min_item = weights[-1]
    result = 0
    for i in range(0, len(weights)):
        flag = 0
        if len(box_old) > 0:
            for j in box_old.keys():
                if weights[i]+box_old[j] <= capacity:
                    box_old[j] = weights[i]+box_old[j]
                    flag = 1
                    break
        if flag == 1:
            continue
        else:
            boxes[len(box_old)] += weights[i]
            box_old[len(box_old)] = boxes[len(box_old)]
            result += 1

    return result

def FFD(weights, capacity):
    # weights = [2,3,3,4,5,6,7]
    # capacity = 10
    boxes = [0 for i in range(len(weights))]
    box_old = {}
    # 数组倒序
    weights = sorted(weights, reverse=True)
    min_item = weights[-1]
    result = 0
    for i in range(0, len(weights)):
        suitable = capacity
        flag = 0
        if len(box_old) > 0:
            for j in box_old.keys():
                if weights[i]+box_old[j] <= capacity:
                    left = capacity - (weights[i]+box_old[j])
                    if left < suitable:
                        suitable = left
                        box_old[j] = weights[i]+box_old[j]
                        flag = 1
        if flag == 1:
            continue
        else:
            boxes[len(box_old)] += weights[i]
            box_old[len(box_old)] = boxes[len(box_old)]
            result += 1
    #for i in box_old.values():
       # print(capacity - i)
    return result

def getNeighbourhood(demand, neighbourNum):
    neighbourRoutes = [[] for i in range(neighbourNum)]
    mutation = math.ceil(len(demand)*0.15)
    for i in range(1, neighbourNum+1):
        tempRoute = copy.deepcopy(demand)
        for j in range(1, mutation):
            # random.seed(i*j)
            positionA, positionB = random.sample(range(0, len(demand)), 2)
            # print(positionA, positionB)
            tempRoute[positionA], tempRoute[positionB] = tempRoute[positionB], tempRoute[positionA]
        # print("tempRoute",tempRoute)
        neighbourRoutes[i-1] = tempRoute
    return neighbourRoutes

